func NewDeepcoin(userConfig map[string]interface{}) *Deepcoin {
   p := NewDeepcoinCore()
   p.Init(userConfig)
   return &Deepcoin{
       DeepcoinCore: p,
       Core:  p,
       exchangeTyped: NewExchangeTyped(&p.Exchange),
   }
}
func NewDeepcoinFromCore(core *DeepcoinCore) *Deepcoin {
   return &Deepcoin{
       DeepcoinCore: core,
       Core:  core,
       exchangeTyped: NewExchangeTyped(&core.Exchange),
   }
}

